import React, { useState, useEffect } from 'react';
import '@telegram-apps/telegram-ui/dist/styles.css';
import { AppRoot, List, Chip, Avatar, Image } from '@telegram-apps/telegram-ui';
import { MyTabbar } from './components/MyTabbar';
import NewtonLogo from '../src/images/apologonobg.png';
import LoadingPage from './components/LoadingPage';
import { retrieveLaunchParams } from '@telegram-apps/sdk';

export const App = () => {
  const { initDataRaw } = retrieveLaunchParams();
  const [error, setError] = useState(null);
  const [user, setUser] = useState(null);
  const [apiData, setApiData] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const tg = window.Telegram.WebApp;
    tg.ready();

    const telegramUser = tg.initDataUnsafe?.user || null;
    setUser(telegramUser);

    const { secondary_bg_color } = tg.themeParams || {};
    if (secondary_bg_color) {
      document.body.style.backgroundColor = secondary_bg_color;
    }

    // First authenticate
    fetch('http://37.27.29.15:3000/auth/login', {
      method: 'POST',
      headers: {
        'Authorization': `tma ${initDataRaw}`,
        'Content-Type': 'application/json',
        'Accept': 'application/json',
        'Access-Control-Allow-Origin': '*'
      },
      credentials: 'include',
      mode: 'cors',
      body: JSON.stringify({
        initData: initDataRaw
      }),
    })
    .then(response => {
      console.log('Auth Response:', response);
      if (!response.ok) {
        throw new Error(`Auth failed: ${response.status} ${response.statusText}`);
      }
      return response.json();
    })
    .then(authData => {
      console.log('Auth successful:', authData);
      
      // After successful auth, fetch user data
      return fetch('http://37.27.29.15:3000/user/me', {
        headers: {
          'Authorization': `tma ${initDataRaw}`,
          'Accept': 'application/json',
          'Access-Control-Allow-Origin': '*'
        },
        credentials: 'include',
        mode: 'cors'
      });
    })
    .then(response => {
      console.log('User Response:', response);
      if (!response.ok) {
        throw new Error(`User data failed: ${response.status} ${response.statusText}`);
      }
      return response.json();
    })
    .then(data => {
      console.log('User data received:', data);
      setApiData(data);
      setLoading(false);
    })
    .catch(error => {
      console.error('Detailed Error:', {
        message: error.message,
        name: error.name,
        stack: error.stack
      });
      setError(error.message);
      setLoading(false);
    });
  }, [initDataRaw]);

  // Added debug output
  console.log('Current state:', {
    user,
    apiData,
    loading,
    error,
    initDataRaw
  });

  if (loading) {
    return (
      <AppRoot>
        <LoadingPage />
        <div>Loading... Please wait</div>
      </AppRoot>
    );
  }

  if (error) {
    return (
      <AppRoot>
        <div style={{ padding: 20, color: 'red' }}>
          <h3>Error occurred:</h3>
          <p>{error}</p>
          <p>Init Data: {initDataRaw ? 'Present' : 'Missing'}</p>
        </div>
      </AppRoot>
    );
  }

  return (
    <AppRoot>
      <div style={{
        display: 'flex',
        flexDirection: 'column',
        height: '100vh',
        overflow: 'hidden',
      }}>
        <List style={{
          background: 'var(--tgui--secondary_bg_color)',
          padding: 10,
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
          flexShrink: 0,
        }}>
          <div style={{
            display: 'flex',
            gap: 25,
            alignItems: 'center',
          }}>
            <Chip mode="elevated" before={<Avatar size={20} />}>
              {user?.first_name || 'Guest'}
            </Chip>
            <Image
              size={64}
              src={NewtonLogo}
              alt="App logo"
            />
            <Chip mode="outline" before={<Avatar size={20} />}>
              {apiData?.tokens ?? 0}
            </Chip>
          </div>
        </List>

        <MyTabbar />
      </div>
    </AppRoot>
  );
};

export default App;
